import React, { memo } from 'react';

import { Grid, Input, Button, Typography } from '@material-ui/core';

import useStyles from './styled';

const RecoveryForm = ({ firstLabel, secondLabel, changeTitle, setSuccess }) => {
  const classes = useStyles();
  return (
    <Grid container direction="column">
      <Typography className={classes.label}>{firstLabel}</Typography>
      <Input variant="outlined" className={classes.input} />
      <Typography className={classes.label}>{secondLabel}</Typography>
      <Input variant="outlined" className={classes.input} />
      <Button
        variant="contained"
        size="large"
        color="primary"
        className={classes.button}
        onClick={() => setSuccess(true)}
      >
        {changeTitle}
      </Button>
    </Grid>
  );
};

export default memo(RecoveryForm);
